import React from 'react';
import { DataGrid } from '@material-ui/data-grid';

export default function App(data) {

  const columns = [
    {
      field: "id",
      type: "number",
      headerName: "ID",
      width: 100,
      editable: false
    },
    {
      field: "title",
      headerName: "Name",
      width: 250,
      editable: false
    },
    {
      field: "amount",
      headerName: "Price",
      type: "number",
      width: 115,
      editable: false
    },
    {
      field: "currency",
      headerName: "Coin",
      width: 120,
      editable: false
    },
    {
      field: "tradeType",
      headerName: "Trade Type",
      type: "number",
      width: 150,
      editable: false
    }
  ];

  const rows = data.data.items.map((row) => {
    const { productId, ...rest } = row;
    return { id: productId, ...rest };
  });

  const [sortModel, setSortModel] = React.useState([
    {
      field: 'amount',
      sort: 'asc',
    },
  ]);

  console.log(rows)
  for (var i = 0; i < rows.length; i++) {
    if (rows[i].tradeType === 1) {
      rows.setRows({
        tradeType: "Buy Now"
      }); 
    } else {
      rows.setRows({
        tradeType: "At auction"
      }); 
    }
  } 

  if (data.data.error) {
    return <div>Error: {data.data.error.message}</div>;
  } else if (!data.data.isLoaded) {
    return <div>Loading...</div>;
  } else {
    return (
      <div style={{ height: 1200, width: "100%" }}>
        <DataGrid
          rows={rows}
          columns={columns}
          sortModel={sortModel}
          onSortModelChange={(model) => setSortModel(model)}
          pageSize={100}
          density="compact"
        />
      </div>
    );
  }
}
